import chunk from "chunk"

export default function Gallery(props) {
  return (
    <div className="flex">
    	{chunk(props.images, Math.round(props.images.length/5)).map(
    		(column) => (
    			<div className="w-1/5">
    				{column.map(i => (
						<img className="p-2" src={require(i)}/>
    				))}
    			</div>
    		)
    	)
		}
    </div>
  )
}
